import React from 'react'
import { Outlet } from 'react-router-dom'
import { NavLink } from 'react-router-dom'
import { MdArticle } from "react-icons/md";
import { FaUserGraduate } from "react-icons/fa";
function UsersProfile() {
  return (
    <div>
      <div className='d-flex justify-content-around m-3'>
      <NavLink className="fs-4 text-white text-decoration-none ab text-center" to={`/usersprofile/articles`} ><MdArticle className='fs-3 m-0' /> View Articles</NavLink>
      <NavLink className="fs-4 text-white text-decoration-none ab text-center" to={`/usersprofile/followauthors`} ><FaUserGraduate className='fs-2 m-0'/>  Authors</NavLink>
      </div>
      <Outlet/>
    </div>
  )
}

export default UsersProfile
